note_models.css:
@font-face {
   font-family: 'IPAGothic';
   font-style: normal;
   font-weight: 400;
   src: url(_ipag.ttf) format('truetype');
 }
:root{
	--highlight: #5E81AC;
	--least-important:#4C566A;
	--highlight2: #BF616A;
	--slight_highlight: #434C5E;
	--default: #2E3440;
	--hint: #5E81AC;
	--dark_hint:#B48EAD;
	--dark_default:#E5E9F0;
	--dark_highlight:#5E81AC;
	--dark_slight_highlight: #88C0D0;
}
body {
margin: 0;
}
.chapter{
	text-style:normal;
	top:0;
	text-decoration:none;
	padding-left:10px;
	color:var(--least-important);
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:right;
	float:right;
	padding-top:10px;
}
.nightMode .chapter{
	color: var(--least-important);
}
.MeaningBack2{
	font-family: Helvetica, IPAGothic;
	color: var(--slight_highlight);
	font-size: 40px;
	padding-top: 7vh;
	padding-left: 10px;
	font-style: normal;
}
.nightMode .MeaningBack2{
	color:var(--dark_slight_highlight);
}
.container {
display: flex;
flex-direction: column;
height: 100vh;
justify-content: center;
align-items: stretch;
}
.card-content {
flex: 1;
padding: 20px;
padding-top:0;
}
.footer {
	padding: 20px;
	padding-bottom: 5px;
	padding-top:0px;
}
.card {
	margin-top: 0px;
	height: 100%;
	font-family:  Helvetica, "IPAGothic", Arial,Verdana,sans-serif;
}
.parent {
  white-space: nowrap;
  padding-top: 30vh;
}
.parentBack {
  white-space: nowrap;
  padding-top: 10vh;
}
#JapaneseFront{
	margin-top:30vh;
	font-size: 120px;
   	font-family: IPAGothic;
	color: var(--highlight);
	height:120px;
}
.nightMode #JapaneseFront{
	color: var(--dark_highlight);
}
#JapaneseBack{
	font-size: 120px;
   	font-family: IPAGothic;
	color: var(--highlight);
	height:120px;
}
.nightMode #JapaneseBack{
	color: var(--dark_highlight);
}
#no {
	color:var(--least-important);
	font-family: Helvetica,Arial,Verdana,sans-serif;
	font-size: 20px;
	text-align:right;
	float:right;
}
.nightMode #no {
	color:var(--least-important);
}
.MeaningBack{
	margin-top:5vh;
	text-align:center;
	font-size: 40px;
   	font-family: Helvetica;
	color: var(--highlight);
}
.nightMode .MeaningBack{
	color: var(--dark_highlight);
}
.MeaningFrontContainer{
	display: flex;
	flex-direction: column;
	height: 80vh;
	width:90vw;
	justify-content:center;
}
.MeaningFront{
 	font-family: Helvetica;
	font-size: 50px;
	color: var(--highlight);
	text-align:left;
	hyphens: auto;
	justify-content: center;
}
.nightMode .MeaningFront{
	color: var(--dark_highlight);
}
.JapaneseBack{
	font-family: Helvetica, IPAGothic;
	color: var(--slight_highlight);
	font-size: 40px;
	padding-top: 10vh;
	font-style: normal;
	margin-bottom:auto;
}
.nightMode .JapaneseBack{
	color: var(--dark_slight_highlight);
}
.ReadingBack{
	font-family: Helvetica, IPAGothic;
	color: var(--least-important);
	font-size: 40px;
	font-style: normal;
	margin-bottom:auto;
}
.nightMode .ReadingBack{
	color: var(--least-important);
}
.PartOfSpeechBack{
	font-family: Helvetica, IPAGothic;
	color: var(--least-important);
	font-size: 30px;
	font-style: normal;
	margin-bottom:auto;
}
.nightMode .PartOfSpeechBack{
	color: var(--least-important);
}
.card .TonBack{
	display:none;
	align:center;
	text-align:center;
	padding-top:25px;
	padding-bottom: 5px;
}

/* ANDROID SETTINGS */
.android .container {
	height: 95vh; /*AnkiDroid seems to calculate vh with area below buttons*/
}
.android .card .nightMode {
	background-color:#000000;
}
.android .TonBack{
	display: float;
}
